//import createStore
import { createStore, applyMiddleware } from "redux";
//import Provider
import { Provider } from "react-redux";
import { reducer } from "./reducer/index";

/* add middleWare */
/* add logger */
const store = createStore(reducer, applyMiddleware(logger, thunk));

ReactDOM.render(
  <BrowserRouter>
